create temporary table if not exists szkola.TimetableTemp (
	ReplacementTeacher_UserID int null,
	TimeStart time not null,
	TimeEnd time not null,
	DayNumber int not null,
	ClassID VARCHAR(50)
);


-- this query takes innfo from TimetableTemp and adds to it random Subject from ClassSubjectTeacher table, based on ClassID
-- and inserts into destination table - Timetable
    Timetable
    (ClassID, ReplacementTeacher_UserID, TimeStart, TimeEnd, DayNumber, SubjectID)
SELECT
       InnerQ.ClassID,
       ReplacementTeacher_UserID,
       TimeStart,
       TimeEnd,
       DayNumber,
       SUBSTRING_INDEX(
           SUBSTRING_INDEX(Subjects, ',',
--                number of commas in Subjects field + 1 -> number of items in concatenated list
--                         V
               FLOOR(1 + RAND() * (LENGTH(Subjects) - LENGTH(REPLACE(Subjects, ',', '')) + 1))
           ),
           ',',
           -1
       ) AS SubjectID
FROM (
      SELECT
             CST.ClassID,
             GROUP_CONCAT(CST.SubjectID) AS Subjects
      FROM
           ClassSubjectTeacher CST
      GROUP BY ClassID
  ) InnerQ
INNER JOIN TimetableTemp on TimetableTemp.ClassID = InnerQ.ClassID

DROP TEMPORARY TABLE TimetableTemp;
